import React from 'react'

export default function Footer() {
  return (
    <footer>
        <span className='footerBottom'>
        <div>Copyright Handcraft Inc. 1986  |  Website Design by</div>
        <div>
          <ul className='urlOfCreater' rel="stylesheet" href="https://www.instagram.com/artem.feskov/"> @Artem Feskov</ul> 
        </div>
          
        
      </span>
        
    </footer>
  )
}
